local function GetClassColor(class)
    if C_ClassColor then
        return C_ClassColor.GetClassColor(class):GenerateHexColor()
    elseif class == "EVOKER" then
        return "#33937F"
    else
        return RAID_CLASS_COLORS[class]:GenerateHexColor()
    end
end

